function submitSearch(){$("#submitSearch").on("click",function(){if(validateInputs()){const a=$("#url").val(),b=$("#searchType").val(),c=$("#searchLimit").val(),d=$("#searchKeyword").val();data={url:a,type:b,number:c,keyword:d},$.ajax({url:"/cookie_handler",method:"GET",data:data,success:function(){clearChart(),socket.emit("random tree",data),clearOutText(),fadeOutForm(),showProgressBar(),parsePastSearchesCookie()},error:function(e){$.alert(e.responseText)}})}})}function validateInputs(){return validateURL($("#url")),validateSearchType($("#searchType")),validateMaxNum($("#searchLimit")),validateKeyword($("#searchKeyword")),validateURL($("#url"))&&validateSearchType($("#searchType"))&&validateMaxNum($("#searchLimit"))&&validateKeyword($("#searchKeyword"))}function validateURL(a){var b=a.val(),c=/^(https?|ftp):\/\/([a-zA-Z0-9.-]+(:[a-zA-Z0-9.&%$-]+)*@)*((25[0-5]|2[0-4][0-9]|1[0-9]{2}|[1-9][0-9]?)(\.(25[0-5]|2[0-4][0-9]|1[0-9]{2}|[1-9]?[0-9])){3}|([a-zA-Z0-9-]+\.)*[a-zA-Z0-9-]+\.(com|edu|gov|int|mil|net|org|biz|arpa|info|name|pro|aero|coop|museum|[a-zA-Z]{2}))(:[0-9]+)*(\/($|[a-zA-Z0-9.,?'\\+&%$#=~_-]+))*$/;return c.test(b)?(a.removeClass("has-error"),!0):(a.addClass("has-error"),!1)}function validateSearchType(a){return"Depth"===a.val()||"Breadth"===a.val()?(a.removeClass("has-error"),!0):(a.addClass("has-error"),!1)}function validateMaxNum(a){return 0<a.val()&&126>a.val()?(a.removeClass("has-error"),!0):(a.addClass("has-error"),!1)}function validateKeyword(a){return""===a.val()?(a.addClass("has-error"),!1):(a.removeClass("has-error"),!0)}function showPostSearch(){$(".postSearchBtns").fadeIn()}function newSearchStart(){$("#searchAgainBtn").on("click",function(){fadeInForm(),$(".postSearchBtns").hide()})}$(document).ready(function(){submitSearch(),newSearchStart()});